import Small from './Small'

function Entry ({small,num,name,email}) {
    return(

        <div class = "entry">

        <div>{num}</div>
        {/* <div>{name}</div> */}
        <div>{email}</div>
        <Small small = {small} name = {name}/>

        <button class = "press delete">Delete</button>

      </div>

    )
}

export default Entry
